import React from 'react';

function Navbar({ logo }) {
  return (
    <nav className="navbar">
      <div className="navbar-brand">
        <img src={logo} alt="Logo" className="logo" />
        <span>Wings Cafe</span>
      </div>
      <ul className="navbar-nav">
        <li><a href="#dashboard" onClick={() => setActiveSection('dashboard')}>Dashboard</a></li>
        <li><a href="#add-product" onClick={() => setActiveSection('add-product')}>Add Product</a></li>
        <li><a href="#products" onClick={() => setActiveSection('products')}>Products</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
